(37, 'Статья тест 2 Статья тест 2 Статья тест 2', 'J6GsYj4jxj35OQkvnox5p9p319TLTlHXiFuiMHgx.jpg', '<p><span style=\"color: rgb(71, 86, 105); font-family: Roboto, Helvetica, sans-serif; font-size: 18px; background-color: rgb(249, 250, 252);\">По умолчанию метки времени отформатированы как&nbsp;</span><code style=\"border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 18px; font-family: &quot;Roboto Mono&quot;, Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; margin: 0px; padding: 2px 6px; vertical-align: baseline; background: rgb(239, 242, 247); border-radius: 3px; height: 18px; color: rgb(71, 86, 105);\"><b>\'Y-m-d H:i:s\'</b></code><span style=\"color: rgb(71, 86, 105); font-family: Roboto, Helvetica, sans-serif; font-size: 18px; background-color: rgb(249, 250, 252);\">. Если вам нужно настроить формат метки времени, установите значение&nbsp;</span><code style=\"border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 18px; font-family: &quot;Roboto Mono&quot;, Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; margin: 0px; padding: 2px 6px; vertical-align: baseline; background: rgb(239, 242, 247); border-radius: 3px; height: 18px; color: rgb(71, 86, 105);\"><i>$dateFormat</i></code><span style=\"color: rgb(71, 86, 105); font-family: Roboto, Helvetica, sans-serif; font-size: 18px; background-color: rgb(249, 250, 252);\">&nbsp;в своей модели. Это свойство определяет, как атрибуты даты хранятся в базе данных, а также их формат, когда модель преобразована в массив или JSON:</span><br></p>', 'statia-test-233', 1, '2018-06-21 17:00:00', '2018-06-21 17:00:00'),
(38, 'Статья тест 3 Статья тест 3 Статья тест 3 Статья тест 3', '0yieHInQAfY3P4aHhZXRRcZ2Enni3oJMxIi4srKL.jpg', '<p>Статья тест 3&nbsp;<span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья т<b>ест 3&nbsp;</b></span><span style=\"font-size: 1rem;\"><b>Статья тест 3&nbsp;</b></span><span style=\"font-size: 1rem;\"><b>С</b>татья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><span style=\"font-size: 1rem;\">Статья тест 3&nbsp;</span><br></p>', 'statia-test-333', 1, '2022-06-17 23:02:55', '2022-06-17 23:02:55');

